/*This function will Concate the text line for a Text ID based on FORMAT_COL 

Format is '*' :
Add line break before this line if not the first one.

Format is '' or only consists of spaces:
Add a space before this line.

Format is '=':
Format is '(':
Add this line without any additional character.

Format is '/':
Format is '/=':
Format is '/(':
Format starts with '>':
Add line break before this line.

Format is '/:'
Format is '/*':
Ignore this line

*/


StringBuilder outputTextContent = new StringBuilder();

for (int j = 0; j < input.length; j++) {

     if (format[j].equals("*")) {
          if (j != 0) {
           outputTextContent.append("\n");
           outputTextContent.append(input[j]);
          } else {
           outputTextContent.append(input[j]);
          }
     }

     else if (format[j].equals("") || format[j].trim().length() == 0) {
      outputTextContent.append(" ");
      outputTextContent.append(input[j]);
     } 

     else if (format[j].equals("=")) {
      outputTextContent.append(input[j]);
     } 

     else if (format[j].equals("(") || format[j].equals("/") || format[j].equals("/=") || format[j].equals("/(") || format[j].equals(">")) {
      outputTextContent.append("\n");
      outputTextContent.append(input[j]);
     } 

     else if (format[j].equals("/:") || format[j].equals("/*")) {
      continue;
     } 

     else {
      outputTextContent.append(input[j]);
     }
}
result.addValue(outputTextContent.toString());

